import { Link } from "react-router-dom";

export default function(){

    return(<>
    <div className="row" style={{backgroundColor:"rgb(54,69,79)",minHeight:"100px"}}>
        <div className="col-xs-6 col-sm-4"><Link to="/LatestMovies" style={{color:"white"}}>Latest Movies</Link></div>
        <div className="col-xs-6 col-sm-4"><Link to="/UpcomingMovies" style={{color:"white"}}>Upcoming Movies</Link></div>
        <div className="col-xs-6 col-sm-4"><Link to="/NearByEvents"  style={{color:"white"}}>Near By Event</Link></div>

    </div>
    </>)
}
